import React from 'react'

function Video() {
  return (
    <div class="w-fit">
        <a href="http://www.google.com">
            <img src="https://drive.google.com/file/d/1Xiu8HxSdqYqEvXCO1R_cNXGIgOsBJrwb/view?usp=sharing" loop="infinite" />
        </a>
    </div>
  )
}

export default Video
